"use strict";(self.webpackChunkwaste_of_space_wiki=self.webpackChunkwaste_of_space_wiki||[]).push([[1762],{54514:e=>{e.exports=JSON.parse('{"tag":{"label":"Programmable","permalink":"/Pilot.lua-Luau-LSP/tags/programmable","allTagsPath":"/Pilot.lua-Luau-LSP/tags","count":52,"items":[{"id":"objects/ARController","title":"ARController","description":"Like a TouchScreen, but for your actual screen.","permalink":"/Pilot.lua-Luau-LSP/objects/ARController"},{"id":"objects/Assembler","title":"Assembler","description":"Assembles items as configured when the structure is supplied with the required power and resources.","permalink":"/Pilot.lua-Luau-LSP/objects/Assembler"},{"id":"objects/Battery","title":"Battery","description":"A light part that contains 400 energy and is prefilled. Cannot be recharged.","permalink":"/Pilot.lua-Luau-LSP/objects/Battery"},{"id":"objects/Bin","title":"Bin","description":"Stores solid items such as Aluminum, Iron, Faucets, etc.","permalink":"/Pilot.lua-Luau-LSP/objects/Bin"},{"id":"objects/BlackBox","title":"BlackBox","description":"Records all activity in the region using very delicate instruments.","permalink":"/Pilot.lua-Luau-LSP/objects/BlackBox"},{"id":"objects/Blade","title":"Blade","description":"A legacy pre-component part. A sharp object that can pierce through objects if the material is durable and strong.","permalink":"/Pilot.lua-Luau-LSP/objects/Blade"},{"id":"objects/Component","title":"Component","description":"A portable component. May be installed on parts to add unique behaviours.","permalink":"/Pilot.lua-Luau-LSP/objects/Component"},{"id":"objects/Constructor","title":"Constructor","description":"Similar to an assembler, but constructs a model when triggered. However, the Constructor must be supplied with the correct materials for a model.","permalink":"/Pilot.lua-Luau-LSP/objects/Constructor"},{"id":"objects/Coupler","title":"Coupler","description":"Will connect to nearby couplers with matching CouplerIDs when activated by Polysilicon. Deactivating via Polysilicon will detach two couplers. Repeatedly emits trigger signals when it is able to connect with another coupler of the same ID.","permalink":"/Pilot.lua-Luau-LSP/objects/Coupler"},{"id":"objects/DevBattery","title":"DevBattery","description":"A debug item meant for developers.","permalink":"/Pilot.lua-Luau-LSP/objects/DevBattery"},{"id":"objects/DevHeatStorage","title":"DevHeatStorage","description":"A debug item meant for developers.","permalink":"/Pilot.lua-Luau-LSP/objects/DevHeatStorage"},{"id":"objects/DevSink","title":"DevSink","description":"A debug item meant for developers.","permalink":"/Pilot.lua-Luau-LSP/objects/DevSink"},{"id":"objects/DevSource","title":"DevSource","description":"A debug item meant for developers.","permalink":"/Pilot.lua-Luau-LSP/objects/DevSource"},{"id":"objects/Disk","title":"Disk","description":"A programmable object capable of storing complex data.","permalink":"/Pilot.lua-Luau-LSP/objects/Disk"},{"id":"objects/Dispenser","title":"Dispenser","description":"Releases items from attached bins.","permalink":"/Pilot.lua-Luau-LSP/objects/Dispenser"},{"id":"objects/Door","title":"Door","description":"A legacy pre-component part. When triggered, it will open, and if triggered again will close.","permalink":"/Pilot.lua-Luau-LSP/objects/Door"},{"id":"objects/EnergyShield","title":"EnergyShield","description":"Generates a forcefield protecting its interior from energy-based weapons such as Lasers and PlasmaCannons, and offers full protection from Warhead explosions.","permalink":"/Pilot.lua-Luau-LSP/objects/EnergyShield"},{"id":"objects/Gyro","title":"Gyro","description":"Stabilizes vehicles and structures by pointing upwards. Useful for mechs or orientating structures to the correct rotation. Has a maximum range of 75000 studss. The gyro can also be configured to seek objects and players.","permalink":"/Pilot.lua-Luau-LSP/objects/Gyro"},{"id":"objects/HeatCell","title":"HeatCell","description":"Legacy test item. Stores heat energy.","permalink":"/Pilot.lua-Luau-LSP/objects/HeatCell"},{"id":"objects/Hull","title":"Hull","description":"A legacy pre-component part. Is able to float in the water, as well as carry objects attached to it. Primarily used for creating boats and other water craft.","permalink":"/Pilot.lua-Luau-LSP/objects/Hull"},{"id":"objects/HyperDrive","title":"HyperDrive","description":"A device used to travel at faster than light speeds to other regions of the universe.","permalink":"/Pilot.lua-Luau-LSP/objects/HyperDrive"},{"id":"objects/Instrument","title":"Instrument","description":"A part that measures information about the world.","permalink":"/Pilot.lua-Luau-LSP/objects/Instrument"},{"id":"objects/Keyboard","title":"Keyboard","description":"Similar to a button, except is programmable to take more than one key input.","permalink":"/Pilot.lua-Luau-LSP/objects/Keyboard"},{"id":"objects/LifeSensor","title":"LifeSensor","description":"Senses and detects organic life up to a distance of 2000 studs. It only has a purpose within programming.","permalink":"/Pilot.lua-Luau-LSP/objects/LifeSensor"},{"id":"objects/Light","title":"Light","description":"Emits light when powered with electricity. Can be colored in different ways, changing the light color.","permalink":"/Pilot.lua-Luau-LSP/objects/Light"},{"id":"objects/LightTube","title":"LightTube","description":"Emits light when powered with electricity. Can be colored in different ways, changing the light color.","permalink":"/Pilot.lua-Luau-LSP/objects/LightTube"},{"id":"objects/Microcontroller","title":"Microcontroller","description":"Runs limited Roblox luau code in an environment called \\"pilot.lua\\".","permalink":"/Pilot.lua-Luau-LSP/objects/Microcontroller"},{"id":"objects/Microphone","title":"Microphone","description":"Used in programming. Takes user\'s input from chat.","permalink":"/Pilot.lua-Luau-LSP/objects/Microphone"},{"id":"objects/Modem","title":"Modem","description":"A part that allows you to send messages cross-region and make HTTP requests to the web.","permalink":"/Pilot.lua-Luau-LSP/objects/Modem"},{"id":"objects/ObjectDetector","title":"ObjectDetector","description":"Casts a ray on the face with the hole on it, returning data of the object the ray hits.","permalink":"/Pilot.lua-Luau-LSP/objects/ObjectDetector"},{"id":"objects/PilotObject","title":"PilotObject","description":"The base object that all other objects inherit from.","permalink":"/Pilot.lua-Luau-LSP/objects/PilotObject"},{"id":"objects/Piston","title":"Piston","description":"More accurately a linear actuator. There is a rail among us.","permalink":"/Pilot.lua-Luau-LSP/objects/Piston"},{"id":"objects/PowerCell","title":"PowerCell","description":"Stores electricity, and is used to power many devices using wires or by directly attaching it.","permalink":"/Pilot.lua-Luau-LSP/objects/PowerCell"},{"id":"objects/ProximityButton","title":"ProximityButton","description":"Sends trigger signals when interacted via its ProximityPrompt.","permalink":"/Pilot.lua-Luau-LSP/objects/ProximityButton"},{"id":"objects/Rail","title":"Rail","description":"Slides and moves objects along its surface when powered and triggered.","permalink":"/Pilot.lua-Luau-LSP/objects/Rail"},{"id":"objects/Reactor","title":"Reactor","description":"Generates steam using water and heat from radiation.","permalink":"/Pilot.lua-Luau-LSP/objects/Reactor"},{"id":"objects/Scanner","title":"Scanner","description":"An end-game part which can remotely retrieve Microcontroller references to parts, providing information and control. Can also triangulate the positions of enemy parts given enough well placed scanners.","permalink":"/Pilot.lua-Luau-LSP/objects/Scanner"},{"id":"objects/Screen","title":"Screen","description":"Allows for the programmatic creation of GUI elements.","permalink":"/Pilot.lua-Luau-LSP/objects/Screen"},{"id":"objects/Seat","title":"Seat","description":"It is a craftable and spawnable non-flammable solid.","permalink":"/Pilot.lua-Luau-LSP/objects/Seat"},{"id":"objects/Servo","title":"Servo","description":"Spins objects attached to the hinge at the front when powered, to set angles.","permalink":"/Pilot.lua-Luau-LSP/objects/Servo"},{"id":"objects/Speaker","title":"Speaker","description":"Plays audio of length up to 5 seconds, unless it is powered in which case it can play a full audio.","permalink":"/Pilot.lua-Luau-LSP/objects/Speaker"},{"id":"objects/Spotlight","title":"Spotlight","description":"Emits light in a cone when powered with electricity. Color emition can be changed by coloring it.","permalink":"/Pilot.lua-Luau-LSP/objects/Spotlight"},{"id":"objects/StarMap","title":"StarMap","description":"Shows your current location in the universe and other nearby stars and celestial bodies.","permalink":"/Pilot.lua-Luau-LSP/objects/StarMap"},{"id":"objects/SteamTurbine","title":"SteamTurbine","description":"Produces power from steam at a base rate of 100 power each. Improves up to 250 per steam if consecutively ran at max speed. All bonuses are capped to the real consumption rate, so more steam equals better efficiency, but faster consumption rates. It may consume +0.5/s^2 steam, up to a maximum rate of 10 steam per second (for a total of 2500 power per second). Has a 10% chance to recover water for every steam consumed, improving up to 20%. Maximum efficiency can be reached in no less than 18 seconds if fed an optimal amount of steam.","permalink":"/Pilot.lua-Luau-LSP/objects/SteamTurbine"},{"id":"objects/Tank","title":"Tank","description":"Stores liquids and gases. When a liquid or gas touches the Tank, the Tank will automatically store it. Will not conduct heat when containing a fluid, making it a good heat storage part.","permalink":"/Pilot.lua-Luau-LSP/objects/Tank"},{"id":"objects/Telescope","title":"Telescope","description":"A device that allows you to see and query information about other regions and planets in space while powered.","permalink":"/Pilot.lua-Luau-LSP/objects/Telescope"},{"id":"objects/TemperatureGate","title":"TemperatureGate","description":"The gate will allow power to pass through it while the temperature is in a certain range.","permalink":"/Pilot.lua-Luau-LSP/objects/TemperatureGate"},{"id":"objects/TemperatureSensor","title":"TemperatureSensor","description":"When the surrounding temperature is within the defined range, it will emit a trigger signal every two seconds.","permalink":"/Pilot.lua-Luau-LSP/objects/TemperatureSensor"},{"id":"objects/TouchScreen","title":"TouchScreen","description":"A Screen, but can handle player mouse input.","permalink":"/Pilot.lua-Luau-LSP/objects/TouchScreen"},{"id":"objects/TouchSensor","title":"TouchSensor","description":"Sends trigger signals upon contact.. with anything.","permalink":"/Pilot.lua-Luau-LSP/objects/TouchSensor"},{"id":"objects/VehicleSeat","title":"VehicleSeat","description":"Allows players to control vehicles by rotating when sat on.","permalink":"/Pilot.lua-Luau-LSP/objects/VehicleSeat"},{"id":"objects/Winch","title":"Winch","description":"A special device used to control the length of constraints attached to it.","permalink":"/Pilot.lua-Luau-LSP/objects/Winch"}],"unlisted":false}}')}}]);